import React from "react";
import axios from "axios";

import "./App.css";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      dt: [],
    };
  }

  call = () => {
    var b = [];
    var self = this;
    axios
      .get("http://localhost:5000/data")
      .then((response) => {
        // handle success
        var a = JSON.stringify(response);


        var separators = [
          " ",
          "\\n",
          "'",
          "\\*",
          "/",
          ":",
          "\\?",
        ];
        console.log(separators.join("|"));
         b = a.split(new RegExp(separators.join("|"), "g"));

        console.log(b);
        self.setState({ dt: b });
        console.log(self.state.dt);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .finally(function () {
        // always executed
      });
  };

  render() {
    return (
      <div>
        <button onClick={() => this.call()}>submit</button>
      </div>
    );
  }
}
export default App;
